%spark 

var str = ""
//println("matrix collected")
for (i <- 0 until mPlotMatrix.numRows()) {
    //println("i: " + i.toString)
    for (j <- 0 until mPlotMatrix.numCols()) {
        str += mPlotMatrix(i, j)
        if (j <= mPlotMatrix.numCols() - 2) { str += "\t" }
    }
    str += "\n"
  }

val tableStr = "col1\tcol2\n"+ str
println("%table\n"+tableStr)
